import React from "react";
import Form from "./Form";
import Spacer from "./Spacer";

const Header = props => {
  return (
    <div>
      <Spacer />
      <div className="nav-container">
        <h1>{props.title}</h1>
        <Form
          className="forms"
          text="Herzlich Willkommen, hier befinden sich all Ihre VertrÃ¤ge."
        />
      </div>
    </div>
  );
};

export default Header;
